import React, { useState, useEffect } from 'react';
import { 
  Users, 
  CheckSquare, 
  Play, 
  Eye, 
  Trash2, 
  Plus,
  Brain,
  Target,
  Clock,
  Star,
  Settings,
  ArrowRight
} from 'lucide-react';

const AgentTaskManager = () => {
  const [activeTab, setActiveTab] = useState('agents');
  const [agents, setAgents] = useState([]);
  const [tasks, setTasks] = useState([]);
  const [loading, setLoading] = useState(false);
  const [selectedAgent, setSelectedAgent] = useState(null);
  const [selectedTask, setSelectedTask] = useState(null);

  useEffect(() => {
    fetchAgents();
    fetchTasks();
  }, []);

  const fetchAgents = async () => {
    try {
      const response = await fetch('/api/agents/created');
      if (response.ok) {
        const data = await response.json();
        setAgents(data.agents || []);
      }
    } catch (error) {
      console.error('Failed to fetch agents:', error);
    }
  };

  const fetchTasks = async () => {
    try {
      const response = await fetch('/api/tasks/created');
      if (response.ok) {
        const data = await response.json();
        setTasks(data.tasks || []);
      }
    } catch (error) {
      console.error('Failed to fetch tasks:', error);
    }
  };

  const executeTask = async (taskId) => {
    try {
      setLoading(true);
      const response = await fetch(`/api/tasks/execute/${taskId}`, {
        method: 'POST'
      });

      if (response.ok) {
        const result = await response.json();
        console.log('Task execution started:', result);
        // You could show a notification or redirect to execution monitor
      }
    } catch (error) {
      console.error('Failed to execute task:', error);
    } finally {
      setLoading(false);
    }
  };

  const AgentCard = ({ agent }) => (
    <div className="card p-4 hover:shadow-md transition-shadow">
      <div className="flex items-start justify-between mb-3">
        <div className="flex items-center space-x-3">
          <div className="p-2 bg-brand-100 rounded-lg">
            <Brain className="w-5 h-5 text-brand-600" />
          </div>
          <div>
            <h3 className="font-semibold text-neutral-900">{agent.name}</h3>
            <p className="text-sm text-neutral-600">{agent.role}</p>
          </div>
        </div>
        <div className="flex items-center space-x-1">
          <span className={`px-2 py-1 rounded-full text-xs font-medium ${
            agent.expertise_level === 'expert' ? 'bg-success-100 text-success-700' :
            agent.expertise_level === 'advanced' ? 'bg-info-100 text-info-700' :
            'bg-neutral-100 text-neutral-700'
          }`}>
            {agent.expertise_level}
          </span>
        </div>
      </div>

      <p className="text-sm text-neutral-700 mb-3 line-clamp-2">
        {agent.goal}
      </p>

      <div className="space-y-2 mb-4">
        <div className="flex items-center justify-between text-xs">
          <span className="text-neutral-500">Tools:</span>
          <span className="font-medium">{agent.tools?.length || 0}</span>
        </div>
        <div className="flex items-center justify-between text-xs">
          <span className="text-neutral-500">Specializations:</span>
          <span className="font-medium">{agent.specializations?.length || 0}</span>
        </div>
        <div className="flex items-center justify-between text-xs">
          <span className="text-neutral-500">Style:</span>
          <span className="font-medium capitalize">{agent.collaboration_style}</span>
        </div>
      </div>

      <div className="flex items-center justify-between">
        <div className="text-xs text-neutral-500">
          Created {new Date(agent.created_at).toLocaleDateString()}
        </div>
        <div className="flex space-x-2">
          <button
            onClick={() => setSelectedAgent(agent)}
            className="btn-secondary btn-sm"
          >
            <Eye className="w-3 h-3 mr-1" />
            View
          </button>
          <button className="btn-primary btn-sm">
            <Settings className="w-3 h-3 mr-1" />
            Configure
          </button>
        </div>
      </div>
    </div>
  );

  const TaskCard = ({ task }) => (
    <div className="card p-4 hover:shadow-md transition-shadow">
      <div className="flex items-start justify-between mb-3">
        <div className="flex items-center space-x-3">
          <div className="p-2 bg-info-100 rounded-lg">
            <Target className="w-5 h-5 text-info-600" />
          </div>
          <div>
            <h3 className="font-semibold text-neutral-900">{task.name}</h3>
            <p className="text-sm text-neutral-600">Assigned to: {task.agent}</p>
          </div>
        </div>
        <div className="flex items-center space-x-1">
          <span className={`px-2 py-1 rounded-full text-xs font-medium ${
            task.priority === 'urgent' ? 'bg-danger-100 text-danger-700' :
            task.priority === 'high' ? 'bg-warning-100 text-warning-700' :
            task.priority === 'medium' ? 'bg-info-100 text-info-700' :
            'bg-neutral-100 text-neutral-700'
          }`}>
            {task.priority}
          </span>
          <span className={`px-2 py-1 rounded-full text-xs font-medium ${
            task.complexity === 'high' ? 'bg-danger-100 text-danger-700' :
            task.complexity === 'medium' ? 'bg-warning-100 text-warning-700' :
            'bg-success-100 text-success-700'
          }`}>
            {task.complexity}
          </span>
        </div>
      </div>

      <p className="text-sm text-neutral-700 mb-3 line-clamp-2">
        {task.description}
      </p>

      <div className="space-y-2 mb-4">
        <div className="flex items-center justify-between text-xs">
          <span className="text-neutral-500">Success Criteria:</span>
          <span className="font-medium">{task.success_criteria?.length || 0}</span>
        </div>
        <div className="flex items-center justify-between text-xs">
          <span className="text-neutral-500">Deliverables:</span>
          <span className="font-medium">{task.deliverables?.length || 0}</span>
        </div>
      </div>

      <div className="flex items-center justify-between">
        <div className="text-xs text-neutral-500">
          Created {new Date(task.created_at).toLocaleDateString()}
        </div>
        <div className="flex space-x-2">
          <button
            onClick={() => setSelectedTask(task)}
            className="btn-secondary btn-sm"
          >
            <Eye className="w-3 h-3 mr-1" />
            View
          </button>
          <button
            onClick={() => executeTask(task.task_id)}
            disabled={loading}
            className="btn-primary btn-sm"
          >
            <Play className="w-3 h-3 mr-1" />
            Execute
          </button>
        </div>
      </div>
    </div>
  );

  const AgentDetailModal = ({ agent, onClose }) => (
    <div className="fixed inset-0 bg-black bg-opacity-50 flex items-center justify-center z-50 p-4">
      <div className="bg-white rounded-xl max-w-2xl w-full max-h-[90vh] overflow-y-auto">
        <div className="p-6">
          <div className="flex items-center justify-between mb-6">
            <div className="flex items-center space-x-3">
              <div className="p-3 bg-brand-100 rounded-lg">
                <Brain className="w-6 h-6 text-brand-600" />
              </div>
              <div>
                <h2 className="text-xl font-semibold text-neutral-900">{agent.name}</h2>
                <p className="text-neutral-600">{agent.role}</p>
              </div>
            </div>
            <button onClick={onClose} className="btn-secondary btn-sm">
              Close
            </button>
          </div>

          <div className="space-y-6">
            <div>
              <h3 className="font-medium text-neutral-900 mb-2">Goal</h3>
              <p className="text-sm text-neutral-700 bg-neutral-50 p-3 rounded-lg">
                {agent.goal}
              </p>
            </div>

            <div>
              <h3 className="font-medium text-neutral-900 mb-2">Backstory</h3>
              <p className="text-sm text-neutral-700 bg-neutral-50 p-3 rounded-lg">
                {agent.backstory}
              </p>
            </div>

            <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
              <div>
                <h3 className="font-medium text-neutral-900 mb-2">Tools</h3>
                <div className="space-y-1">
                  {agent.tools?.map((tool, index) => (
                    <span key={index} className="inline-block px-2 py-1 bg-info-100 text-info-700 rounded text-xs mr-1 mb-1">
                      {tool}
                    </span>
                  ))}
                </div>
              </div>

              <div>
                <h3 className="font-medium text-neutral-900 mb-2">Specializations</h3>
                <div className="space-y-1">
                  {agent.specializations?.map((spec, index) => (
                    <span key={index} className="inline-block px-2 py-1 bg-brand-100 text-brand-700 rounded text-xs mr-1 mb-1">
                      {spec}
                    </span>
                  ))}
                </div>
              </div>
            </div>

            <div className="grid grid-cols-2 gap-4 text-sm">
              <div className="bg-neutral-50 p-3 rounded-lg">
                <div className="font-medium text-neutral-900">Expertise Level</div>
                <div className="text-neutral-700 capitalize">{agent.expertise_level}</div>
              </div>
              <div className="bg-neutral-50 p-3 rounded-lg">
                <div className="font-medium text-neutral-900">Collaboration Style</div>
                <div className="text-neutral-700 capitalize">{agent.collaboration_style}</div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );

  const TaskDetailModal = ({ task, onClose }) => (
    <div className="fixed inset-0 bg-black bg-opacity-50 flex items-center justify-center z-50 p-4">
      <div className="bg-white rounded-xl max-w-2xl w-full max-h-[90vh] overflow-y-auto">
        <div className="p-6">
          <div className="flex items-center justify-between mb-6">
            <div className="flex items-center space-x-3">
              <div className="p-3 bg-info-100 rounded-lg">
                <Target className="w-6 h-6 text-info-600" />
              </div>
              <div>
                <h2 className="text-xl font-semibold text-neutral-900">{task.name}</h2>
                <p className="text-neutral-600">Assigned to: {task.agent}</p>
              </div>
            </div>
            <button onClick={onClose} className="btn-secondary btn-sm">
              Close
            </button>
          </div>

          <div className="space-y-6">
            <div>
              <h3 className="font-medium text-neutral-900 mb-2">Description</h3>
              <p className="text-sm text-neutral-700 bg-neutral-50 p-3 rounded-lg">
                {task.description}
              </p>
            </div>

            <div>
              <h3 className="font-medium text-neutral-900 mb-2">Expected Output</h3>
              <p className="text-sm text-neutral-700 bg-neutral-50 p-3 rounded-lg">
                {task.expected_output}
              </p>
            </div>

            <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
              <div>
                <h3 className="font-medium text-neutral-900 mb-2">Success Criteria</h3>
                <ul className="text-sm text-neutral-700 space-y-1">
                  {task.success_criteria?.map((criteria, index) => (
                    <li key={index} className="flex items-start space-x-2">
                      <CheckSquare className="w-4 h-4 text-success-600 mt-0.5 flex-shrink-0" />
                      <span>{criteria}</span>
                    </li>
                  ))}
                </ul>
              </div>

              <div>
                <h3 className="font-medium text-neutral-900 mb-2">Deliverables</h3>
                <ul className="text-sm text-neutral-700 space-y-1">
                  {task.deliverables?.map((deliverable, index) => (
                    <li key={index} className="flex items-start space-x-2">
                      <ArrowRight className="w-4 h-4 text-info-600 mt-0.5 flex-shrink-0" />
                      <span>{deliverable}</span>
                    </li>
                  ))}
                </ul>
              </div>
            </div>

            <div className="grid grid-cols-2 gap-4 text-sm">
              <div className="bg-neutral-50 p-3 rounded-lg">
                <div className="font-medium text-neutral-900">Priority</div>
                <div className="text-neutral-700 capitalize">{task.priority}</div>
              </div>
              <div className="bg-neutral-50 p-3 rounded-lg">
                <div className="font-medium text-neutral-900">Complexity</div>
                <div className="text-neutral-700 capitalize">{task.complexity}</div>
              </div>
            </div>

            <div className="flex justify-end">
              <button
                onClick={() => {
                  executeTask(task.task_id);
                  onClose();
                }}
                disabled={loading}
                className="btn-primary"
              >
                <Play className="w-4 h-4 mr-2" />
                Execute Task
              </button>
            </div>
          </div>
        </div>
      </div>
    </div>
  );

  return (
    <div className="space-y-6">
      {/* Header */}
      <div className="flex items-center justify-between">
        <div>
          <h2 className="text-2xl font-bold text-neutral-900">Agent & Task Manager</h2>
          <p className="text-neutral-600">Manage your created agents and tasks</p>
        </div>

        {/* Tab Navigation */}
        <div className="flex bg-neutral-100 rounded-lg p-1">
          <button
            onClick={() => setActiveTab('agents')}
            className={`px-4 py-2 rounded-md text-sm font-medium transition-all flex items-center space-x-2 ${
              activeTab === 'agents' 
                ? 'bg-white text-brand-700 shadow-sm' 
                : 'text-neutral-600 hover:text-neutral-800'
            }`}
          >
            <Users className="w-4 h-4" />
            <span>Agents ({agents.length})</span>
          </button>
          <button
            onClick={() => setActiveTab('tasks')}
            className={`px-4 py-2 rounded-md text-sm font-medium transition-all flex items-center space-x-2 ${
              activeTab === 'tasks' 
                ? 'bg-white text-brand-700 shadow-sm' 
                : 'text-neutral-600 hover:text-neutral-800'
            }`}
          >
            <CheckSquare className="w-4 h-4" />
            <span>Tasks ({tasks.length})</span>
          </button>
        </div>
      </div>

      {/* Content */}
      {activeTab === 'agents' ? (
        <div>
          {agents.length === 0 ? (
            <div className="card p-8 text-center">
              <Brain className="w-12 h-12 text-neutral-400 mx-auto mb-4" />
              <h3 className="text-lg font-medium text-neutral-900 mb-2">No Agents Created Yet</h3>
              <p className="text-neutral-600 mb-4">
                Create your first AI agent using natural language descriptions
              </p>
              <button className="btn-primary">
                <Plus className="w-4 h-4 mr-2" />
                Create Agent
              </button>
            </div>
          ) : (
            <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
              {agents.map((agent) => (
                <AgentCard key={agent.agent_id} agent={agent} />
              ))}
            </div>
          )}
        </div>
      ) : (
        <div>
          {tasks.length === 0 ? (
            <div className="card p-8 text-center">
              <Target className="w-12 h-12 text-neutral-400 mx-auto mb-4" />
              <h3 className="text-lg font-medium text-neutral-900 mb-2">No Tasks Created Yet</h3>
              <p className="text-neutral-600 mb-4">
                Create your first task using natural language descriptions
              </p>
              <button className="btn-primary">
                <Plus className="w-4 h-4 mr-2" />
                Create Task
              </button>
            </div>
          ) : (
            <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
              {tasks.map((task) => (
                <TaskCard key={task.task_id} task={task} />
              ))}
            </div>
          )}
        </div>
      )}

      {/* Modals */}
      {selectedAgent && (
        <AgentDetailModal 
          agent={selectedAgent} 
          onClose={() => setSelectedAgent(null)} 
        />
      )}

      {selectedTask && (
        <TaskDetailModal 
          task={selectedTask} 
          onClose={() => setSelectedTask(null)} 
        />
      )}
    </div>
  );
};

export default AgentTaskManager;
